import Image from "./Image";
function ImageList({ images }) {
	console.log(
		"------------------ImageList------------------",
		images
	);
	const imageElements = images.map((image) => {
		return <Image key={image.id} imageURL={image} />;
	});
	return <div className="images-list" style={{display: "flex", }}>{imageElements}</div>;
}

export default ImageList;
